import 'bootstrap/dist/css/bootstrap.min.css';

function header() {
    return (
        <div>
            <header>
                <nav>
                    // eslint-disable-next-line react/jsx-no-comment-textnodes
                    <a>Home</a>
                    // eslint-disable-next-line jsx-a11y/anchor-is-valid
                    <a>Ratings</a>
                </nav>
            </header>
        </div>
    );
}

export default header;
